import UIKit

class MySellRouter: MySellWireframeProtocol {

    weak var viewController: UIViewController?

    static func createModule() -> UIViewController {
        // Change to get view from storyboard if not using progammatic UI
        let view = MySellViewController(nibName: nil, bundle: nil)
        let interactor = MySellInteractor()
        let router = MySellRouter()
        let presenter = MySellPresenter(interface: view, interactor: interactor, router: router)

        view.presenter = presenter
        interactor.presenter = presenter
        router.viewController = view

        return view
    }
}
